import React from 'react'
import { func } from 'prop-types'

function User () {
  return (
    <div>User </div>
  )
}

function Guest () {
  return (
    <div>Guest</div>
  )
}

function App (props) {
  const { val } = { props }
  if(val) return 
  return (
    <>
      <User />
      <Guest />
    </>
  )
}

export default App
